What's in this version:

This update fixes the looping bug and includes over 100 new tones:
Cell Tones (50 new tones!): Our Cell Tones collection is inspired by classic cell phone rings from the 90s.
Minimal Tones (58 new tones!). Discreet, polite alerts that are perfect for a professional environment. Special &quot;Meeting Mode&quot; tones will receive only 1 alert per incoming phone call.
Look for new tones in the Business and Beeps categories and others. Our latest collection, &quot;Beeptronic Tones,&quot; and more are coming soon!

